const ContentPLace = () => {
    const [part1, setPart1] = useState(null);

    useEffect(() => {
        socket.on("displayPart1S", part1 => {
          setPart1(part1);
        });
      }, []);

    return (
        <div className="content-place">
            {part1}
        </div>
    )
}

